    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>

                <Modal  show={props.visible} animation={true}  onHide={props.closeModal} style={styled.container}>
                    <div style={{height: 30,textAlign: 'center'}}>


                    </div>
                    <a style={styled.buttonClose} onClick={props.closeModal}>
                        Close
                    </a>

                </Modal>
            // </>
        // </div>
    );
}
const  styled={
    container:{height: 500,width: 430,marginLeft: 700,marginTop:60,borderRadius:10,alignContent: 'center'},
    buttonClose:{
        // height: 20,
        padding:10,
        marginLeft: 10    }
}
